message: |-
  Just to keep you guys in the loop. We are working on setting up the first Egyptian Geeks Meetup on 26th of August (Saturday). We are still ironing out the wrinkles and setting the details so I don't have all the information to share yet, but I thought it's best to keep you informed that we are doing progress on that regard.

  Date: 26/08/2017
  Time: Morning?
  Location: Likely in Greek Campus
  Setup: 4-5 Talks (20-40 minutes each)
  Sponsor: Wuzzuf will be helping with all the logistics, a shout out for their massive support and helping in putting this thing together.

  If you have ideas, suggestions, or would like to volunteer (or sponsor), leave a comment or drop me a message.
